const mongoose=require("mongoose"),userSchema=new mongoose.Schema({username:{type:String,required:!0,unique:!0},password:{type:String,required:!0},name:{type:String,default:null},mobile:{type:String,default:null},role:{type:String,enum:["superadmin","user","partner"],default:"user"},status:{type:Number,default:1}},{timestamps:!0});module.exports=mongoose.model("User",userSchema);